import React from "react";

const Document = ({documents}) => {
  var docList = documents.map(({ filename, author, id }) => {
    return (
      <div id={id} className="file shadow-sm">
        <h6>{filename}</h6>
        <h6>{author}</h6>
      </div>
    );
  });
  return docList;
};

export default Document;
